exports.command=function(username,password){
	this.maximizeWindow()
	.url('http://192.168.1.236:8083/EHR/index')
		.waitForElementVisible('a[class=brand]' , 60000)
		.pause(200)
		.getLocationInView('#footer')
		.pause(500)
		.useXpath()
		.getLocationInView("//*[@id='globalWrapper']/section[2]/div/div/div[2]/center/div")
		.pause(500)
		.useCss()
		.click('button[class="btn btn-primary btn-sm buttonClass"]')
		.useCss()
		.waitForElementVisible('#username_id' , 60000)
		.pause(500)
        .setValue('#username_id' , username)
        .setValue('#password_id' , password)
        .click('button[class="btn btn-primary"][type="submit"]')
        .waitForElementVisible('header[class=page-header]' , 60000)
        .pause(500)
        return this;
};